//import logo from './logo.svg';
import './App.css';
import { Header } from './components/Header';
import { Home } from './pages/home/Home';
import {BrowserRouter as Router} from "react-router-dom";

function App() {
  return (
    <Router>
      <Header></Header>
      <div className='conta'></div>
      <Home></Home>
    </Router>
  );
}

export default App;
